import { Injectable } from '@angular/core';
import { AngioIRMCerbrale } from '../models/AngioIRMCerbrale';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AngioirmService {
  private apiUrl = 'https://localhost:7129/api/AngioIrmcerbrales';

  constructor(private http: HttpClient) { }
  addang(AngioIRMCerbrale: AngioIRMCerbrale): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', AngioIRMCerbrale);

    return this.http.post<any>(`${this.apiUrl}/addang`, AngioIRMCerbrale, { observe: 'response' });
  }}
